from keras.preprocessing.text import Tokenizer
from keras.preprocessing.sequence import pad_sequences
from keras.models import Sequential
from keras.layers import Embedding, LSTM, Dense
from keras.initializers import Constant
import numpy as np
from keras.optimizers import Adam
import matplotlib.pyplot as plt

maxlen = 500  # Maximum sequence length
tokenizer = Tokenizer()
tokenizer.fit_on_texts(train['headlines'] + ' ' + train['content'])
sequences_train = tokenizer.texts_to_sequences(train['headlines'] + ' ' + train['content'])
sequences_test = tokenizer.texts_to_sequences(test['headlines'] + ' ' + test['content'])
word_index = tokenizer.word_index
X_train = pad_sequences(sequences_train, maxlen=maxlen)
X_test = pad_sequences(sequences_test, maxlen=maxlen)
y_train = np.array(train['label'])
y_test = np.array(test['label'])

#Load GloVe Word Embeddings
embeddings_index = {}
with open('/content/drive/MyDrive/datasets/glove.6B.100d.txt', encoding='utf-8') as f:
    for line in f:
        values = line.split()
        word = values[0]
        coefs = np.asarray(values[1:], dtype='float32')
        embeddings_index[word] = coefs

embedding_dim = 100
embedding_matrix = np.zeros((len(word_index) + 1, embedding_dim))
for word, i in word_index.items():
    embedding_vector = embeddings_index.get(word)
    if embedding_vector is not None:
        embedding_matrix[i] = embedding_vector

# Define LSTM Model
from keras.layers import Dropout
model = Sequential()
model.add(Embedding(len(word_index) + 1,
                    embedding_dim,
                    embeddings_initializer=Constant(embedding_matrix),
                    input_length=maxlen,
                    trainable=False))
model.add(LSTM(64, dropout=0.2, recurrent_dropout=0.2))
model.add(Dropout(0.2))
model.add(Dense(1, activation='sigmoid'))

# Step 4: Compile the Model
model.compile(optimizer='adam',
              loss='binary_crossentropy',
              metrics=['accuracy'])

# Step 5: Train the Model
history=model.fit(X_train, y_train, epochs=20, batch_size=64, validation_split=0.2)

model.save('model2.h5')

from tensorflow.keras.models import load_model
model = load_model('/content/drive/MyDrive/datasets/model2.h5')

# Step 6: Evaluate the Model
loss, accuracy = model.evaluate(X_test, y_test)
print("Test Accuracy:", accuracy)
print("Test Loss:", loss)

# Plot training & validation accuracy values
plt.plot(history.history['accuracy'])
plt.plot(history.history['val_accuracy'])
plt.title('Model Accuracy')
plt.ylabel('Accuracy')
plt.xlabel('Epoch')
plt.legend(['Train', 'Validation'], loc='upper left')
plt.show()

