from sklearn.metrics import confusion_matrix, ConfusionMatrixDisplay, classification_report
import matplotlib.pyplot as plt

# Visualize performance
def visualize_confusion_matrix(y_true, y_pred):
    cm = confusion_matrix(y_true, y_pred)
    disp = ConfusionMatrixDisplay(confusion_matrix=cm, display_labels=['Real', 'Fake'])
    disp.plot(cmap='Blues')
    plt.title('Confusion Matrix')
    plt.xlabel('Predicted Label')
    plt.ylabel('True Label')
    plt.show()

# Make predictions on test data
y_pred = (model.predict(X_test) > 0.5).astype("int32")

# Visualize confusion matrix
visualize_confusion_matrix(y_test, y_pred)

# Classification Report
print(classification_report(y_test, y_pred, target_names=['Real', 'Fake']))

from tensorflow.keras.utils import plot_model
plot_model(model, to_file='model_plot.png', show_shapes=True, show_layer_names=True)

def predict_fake_or_real():
    # Take input from the user
    news_headline = input("Enter the news headline: ")
    news_content = input("Enter the news content: ")

    # Tokenize and pad the input
    sequences = tokenizer.texts_to_sequences([news_headline + ' ' + news_content])
    padded_sequences = pad_sequences(sequences, maxlen=maxlen)

    # Make prediction
    prediction = model.predict(padded_sequences)[0][0]

    # Convert prediction to label
    label = 'Real' if prediction < 0.5 else 'Fake'

    return label, prediction

# Example usage
label, prediction = predict_fake_or_real()
print("Predicted Label:", label)
print("Predicted Probability:", prediction)

